selectBoxIt._addSelectBoxAttributes=function(){var self=this;self._addAttributes(self.selectBox.prop("attributes"),self.dropdown);self.selectItems.each(function(iterator){self._addAttributes($(this).prop("attributes"),self.listItems.eq(iterator));});return self;};$.selectBox.selectBoxIt.prototype._addAttributes=function(arr,elem){var self=this,whitelist=self.options.copyAttributes;if(arr.length){$.each(arr,function(iterator,property){var propName=(property.name).toLowerCase(),propValue=property.value;if(propValue!=="null"&&($.inArray(propName,whitelist)!==-1||propName.indexOf("data")!==-1)){elem.attr(propName,propValue);}});}return self;};